export default class Admin extends Component {
  render() {
    console.log('done')
    return (
        <div>
          <Topbar />
          <div className="content-container">
            <Sidebar />
            <div className="otherPage">
           
                <AdminHome />
               
                </div>
          </div>
        </div>
    );
  }
}
